import * as jsPDF from 'jspdf';

( ( jsPDFAPI => {
    let font          = '';
    const callAddFont = function() {
        this.addFileToVFS( 'Cormorant-Regular-normal.ttf', font );
        this.addFont( 'Cormorant-Regular-normal.ttf', 'Cormorant-Regular', 'normal' );
    };
    jsPDFAPI.events.push( [ 'addFonts', callAddFont ] );
} )( jsPDF.API ) );
